import React from 'react';
import "./card.css"


function Card (props) {    
        return(
            <div className="cardHolder">    
                <span className="img-container" onClick={props.select}>
                    <img alt={props.name} src={props.image} onClick={props.score} />
                </span>


            </div>

        );
    }


export default Card;
